svg.script:
var goLastTitle = null;
function ShowTooltip(e) {
var d = GetSvgDoc(e);
var tt = d.getElementById('GoSvgTooltip');
if (tt != null) {
var title = TitleElementOf(e.getCurrentTarget());
if (title != null) {
var ttText = d.getElementById('GoSvgTooltipText');
if (ttText != null && goLastTitle != title) {
goLastTitle = title;
var newtextnode = d.createTextNode(TextOf(title));
ttText.replaceChild(newtextnode, ttText.getFirstChild());
var ttRect = d.getElementById('GoSvgTooltipRect');
if (ttRect != null) {
ttRect.setAttribute('width', ttText.getComputedTextLength() + 2*ttText.getAttribute('x'));
}
var newy = e.getClientY()-20;
tt.setAttribute('transform', 'translate(' + e.getClientX() + ',' + newy + ')');
}
}
tt.setAttribute('display', 'inherit')
}
}
function HideTooltip(e) {
var d = GetSvgDoc(e);
var tt = d.getElementById('GoSvgTooltip');
if (tt != null) {
tt.setAttribute('display', 'none')
}
}
function GetSvgDoc(e) {
var t = e.getTarget();
if (t.getNodeType() != 9)
return t.getOwnerDocument();
else
return t;
}
function AddTitleEvents(elt) {
var c = elt.getChildNodes();
for (var i = 0; i < c.getLength(); i++) {
if (c.item(i).getNodeType() == 1)
AddTitleEvents(c.item(i));
}
if (TitleElementOf(elt) != null) {
elt.addEventListener('mouseover', ShowTooltip, false);
elt.addEventListener('mouseout', HideTooltip, false);
}
}
function TitleElementOf(elt) {
var c = elt.getChildNodes();
for (var i = 0; i < c.getLength(); i++)
if (c.item(i).getNodeType() == 1 && c.item(i).getNodeName() == 'title')
return c.item(i);
return null;
}
function TextOf(elt) {
var c = elt.getChildNodes();
for (var i = 0; c && i < c.getLength(); i++)
if (c.item(i).getNodeType() == 3)
return c.item(i).getNodeValue();
return '';
}
